      .crown-magic-wrap ul {
        width: 100%;
        height: 100%;
        display: grid;
        grid-template-columns: 33% 33% 33%;
        grid-template-rows: 33% 33% 33%;
        transform: translate(0%, 0%);
      }

      .crown-magic-wrap ul li {
        width: 100%;
        height: 100%;
        position: relative;
      }
      .crown-magic-wrap ul li:nth-child(5) {
        grid-column-start: 2;
        grid-column-end: 3;
        grid-row-start: 2;
        grid-row-end: 3;
        transform: scale(1);
      }

      .crown-magic-wrap ul li img {
        width: 100%;
      }
      .crown-magic-wrap-head {
        position: absolute;
        left: 13%;
        top: -25%;
        width: 73%;
        z-index: 8;
      }
      .start {
        display: flex;
        justify-content: center;
        align-items: flex-end;
        width: 100%;
        height: 100%;
        background-repeat: no-repeat;
        background-size: 80% 80%;
        background-position: center center;
      }

      .crown-magic-wrap ul li.xx.item-xx {
        width: 1rem;
        height: 1rem;
        line-height: 0.4rem;
        margin: 0.2rem magic 0 magic;
        background-color: #041726;
        padding: 0.14rem 0.14rem 0.14rem 0.16rem;
        font-size: 0.33rem;
        color: #035d68;
      }

      .crown-magic-wrap ul li.rw {
        display: flex;
        justify-content: center;
        align-items: center;
        background-repeat: no-repeat;
        background-size: 100% 100%;
        background-position: center center;
      }

      .crown-magic-wrap ul li.rw.header {
        display: flex;
        height: 30%;
        justify-content: center;
      }

      .header {
        display: flex;
        height: 30%;
        justify-content: center;
      }

      .crown-magic-wrap ul li.rw img {
        width: 92%;
        height: 76%;
      }

      .crown-magic-wrap ul li.rw.name {
        width: 100%;
        height: 100%;
        line-height: 0.32rem;
        margin: 0 magic;
        text-align: center;
        font-size: 0.23rem;
        background-repeat: no-repeat;
        background-size: 100%100%;
        background-position: center center;
        color: #00ffff;
      }

      .crown-magic-wrap ul li.rw:nth-child(1)img,
      .crown-magic-wrap ul li.rw:nth-child(4)img,
      .crown-magic-wrap ul li.rw:nth-child(10)img,
      .crown-magic-wrap ul li.rw:nth-child(13)img {
        margin-top: -10px;
        margin-left: -10px;
        width: 100%;
        height: 100%;
